
var g_currentCameraIndex = 0;

function Unload()
{	
	CloseVideo();
}

function OpenVideo()
{
	var ScanCtrl = document.getElementById("ScanCtrl");
	var nRets = ScanCtrl.camInitCameraLib();
	
	
	var nRets = ScanCtrl.camInitFace();
	if(nRets != 0)
	{
		alert("人脸初始化失败" + "error code = " + nRets);
		return;
	}
	
	
	nRets = ScanCtrl.camOpenDev(g_currentCameraIndex,0,0,0);
	if(nRets != 0)
	{
		alert("打开设备失败" + "error code = " + nRets);
	}
	
	
}

function CloseVideo()
{
	var ScanCtrl = document.getElementById("ScanCtrl");
	ScanCtrl.camCloseDev(g_currentCameraIndex);
	ScanCtrl.camUnInitCameraLib();
	ScanCtrl.camUnInitFace();
}

function DrawFaceRect()
{
	var ScanCtrl = document.getElementById("ScanCtrl");
	ScanCtrl.camSetImageAutoCrop(g_currentCameraIndex,5); 
}


function comparePic(isFilePath)
{
	var ScanCtrl = document.getElementById("ScanCtrl");
	var filePath = document.getElementById("imgOne").value;
	var filePath2 = document.getElementById("imgTwo").value;
	var score = 0;
	if(isFilePath)
	{
		score = ScanCtrl.camMatchFaceByFile(filePath,filePath2);
		
	}else{
		
		var bs1 = ScanCtrl.FileToBase64(filePath);
		//alert("图像1的base64" + bs1);
		var bs2 = ScanCtrl.FileToBase64(filePath2);
		//alert("图像2的base64" + bs2);
		score = ScanCtrl.camMatchFaceByBase64(bs1,bs2);
		
	}
	alert(score);
}

